            $mapaProvincias = [];

            $this->command->info('Migrando Departamentos (Perú)...');
            foreach ($rawDepartamentos as $dep) {
                $nuevoId = DB::table('ubigeo')->insertGetId([
                    'nombre'        => $dep['descripcion'],
                    'codigo_postal' => $dep['ubigeo'],
                    'nivel'         => 1,
                    'parent_id'     => null,
                    'created_at'    => now(),
                    'updated_at'    => now(),
                ]);
                $mapaDepartamentos[$dep['id']] = $nuevoId;
            }

            $this->command->info('Migrando Provincias (Perú)...');
            foreach ($rawProvincias as $prov) {
                $padreIdReal = $mapaDepartamentos[$prov['departamento_id']] ?? null;

                if ($padreIdReal) {
                    $nuevoId = DB::table('ubigeo')->insertGetId([
                        'nombre'        => $prov['descripcion'],
                        'codigo_postal' => $prov['ubigeo'],
                        'nivel'         => 2,
                        'parent_id'     => $padreIdReal,
                        'created_at'    => now(),
                        'updated_at'    => now(),
                    ]);
                    $mapaProvincias[$prov['id']] = $nuevoId;
                }
            }

            if (!empty($rawDistritos)) {
                $this->command->info('Migrando Distritos (Perú)...');
                $batchDistritos = [];
                
                foreach ($rawDistritos as $dist) {
                    $padreIdReal = $mapaProvincias[$dist['provincia_id']] ?? null;

                    if ($padreIdReal) {
                        $batchDistritos[] = [
                            'nombre'        => $dist['descripcion'],
                            'codigo_postal' => $dist['ubigeo'],
                            'nivel'         => 3,
                            'parent_id'     => $padreIdReal,
                            'created_at'    => now(),
                            'updated_at'    => now(),
                        ];
                    }
                }

                foreach (array_chunk($batchDistritos, 500) as $chunk) {
                    DB::table('ubigeo')->insert($chunk);
                }
            } else {
                $this->command->warn('No se encontraron distritos. Asegúrate de copiar el array en la variable $rawDistritos.');
            }
        }); 
